import React from 'react';
import "./sideMenu.css";

export default function sideMenu() {
    return (
        <div>
            <div className="sideMenu">
                <div className="sideMenu-Header">
                    <div className="image"></div>
                    <div className="text">School name</div>
                </div>
                <div className="headings-Container"></div>
            </div>
        </div>
    )
}
